import { Component,AfterViewInit,ViewChild,OnInit } from '@angular/core';
import {MatPaginator, MatPaginatorModule} from '@angular/material/paginator';
import {MatTableDataSource, MatTableModule} from '@angular/material/table';
import { Branch } from './Interfaces/branch';
import { BranchService } from './Services/branch.service';
import {MatDialog} from '@angular/material/dialog';
import { DialogAddEditComponent } from './Modals/dialog-add-edit/dialog-add-edit.component';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css'],

})
export class AppComponent implements AfterViewInit, OnInit{
  title = 'Test Quala';
  displayedColumns: string[] = ['branchCode', 'branchDescription', 'branchAddress', 'branchId', 'branchDateCreation','currencyName','Actions'];
  dataSource = new MatTableDataSource<Branch>();
  constructor(
    private _empleadoServicio:BranchService,
    public dialog: MatDialog ){}


    showBranches(){
      this._empleadoServicio.getList().subscribe({
        next:(data)=>{
          console.log(data);
          this.dataSource.data=data;
        },error:(e)=>{}
      })
    }

    openDialogAddEdit() {
      this.dialog.open(DialogAddEditComponent);
    }

  @ViewChild(MatPaginator) paginator!: MatPaginator;

  ngAfterViewInit() {
    this.dataSource.paginator = this.paginator;
  }

  applyFilter(event: Event) {
    const filterValue = (event.target as HTMLInputElement).value;
    this.dataSource.filter = filterValue.trim().toLowerCase();
  }

  ngOnInit(): void {
    this.showBranches();
  }


}

